import styled from "styled-components";
import Logo from '../Logo';
import NavBar from "../NavBar";
import IconesNavBar from "../IconesNavBar";



const HeaderContainer = styled.header`
    display: flex;
    flex-direction: column; 
    align-items: center;
    width: 100%;
    back
`


function Header() {
  
        <HeaderContainer>
        <Logo />
        <NavBar />
        <IconesNavBar />
    </HeaderContainer>
}
    
   


export default Header
